def get_vocab(dataset):
    vocab = set()
    dloader = torch.utils.data.DataLoader(dataset, batch_size=1, num_workers=0)
    for example in tqdm(dloader, 'Collect unique words'):
        sentence = dataset.text_transform.clean_text(example['text'][0])
        for word in sentence.split():
            vocab.add(word.lower())
    return sorted(vocab)

if __name__ == '__main__':
    FLAGS(sys.argv)
    trainset = H5EmgDataset(dev=False,test=False)
    devset = H5EmgDataset(dev=True)
    testset = H5EmgDataset(test=True)

    train_vocab = get_vocab(trainset)
    dev_vocab = get_vocab(devset)
    test_vocab = get_vocab(testset)
    full_vocab = sorted(set(train_vocab) | set(dev_vocab) | set(test_vocab))

    print(f"Full vocab: {full_vocab}")
